import React from "react";
const Hazem = (state)=>{
const{items,DeleteItem,handleSubmit}=state;
const ml = items.map(item=>{
    return(
    <div>
                <button type="submit" onClick={handleSubmit}>Add Course</button>

 <button type="submit" onClick={()=>DeleteItem(item.id)}>Delete Course</button>   

    </div>)
})
return(
    <div>
{ml}
    </div>
)
}
export default Hazem;
